<script>
   var time0= document.getElementsByClassName('time0')[0]
   var time= document.getElementsByClassName('time')[0]

   var name1= document.getElementsByClassName('name')[0]
   var nameinput= document.getElementsByClassName('nameinput')[0]

   var timed1=new Date()
        var M=timed1.getMonth()+1
        var D=timed1.getDate()
        var num=timed1.getTime()
        const nums=Number(num)-237600000
        const timed2=new Date(nums)
        var M2=timed2.getMonth()+1
        var D2=timed2.getDate()
        var h2=timed2.getHours()>21?21:timed2.getHours()<8?8:timed2.getHours()
        var m2=Math.floor(Math.random()*50+10)
 
    changeTime()
    setInterval(()=>{
            changeTime()
    },1000)


   function changeTime(){
        var timedata=new Date()
        var h=timedata.getHours()<10?"0"+timedata.getHours():timedata.getHours()
        var m=timedata.getMinutes()<10?"0"+timedata.getMinutes():timedata.getMinutes()
        var s=timedata.getSeconds()<10?"0"+timedata.getSeconds():timedata.getSeconds()
        var str0=h+":"+m
        var str1=M+"æœˆ"+D+"æ—¥"
        var str2=h+":"+m+":"+s
        var str3=M2+"æœˆ"+D2+"æ—¥ "+h2+":"+m2
        time.innerHTML='<div>'+str1+'</div>'+'<div>'+str2+'</div>'
        time0.innerHTML='<div>'+str0+'</div>'
    }

    function changename(){
       nameinput.style.display= nameinput.style.display==="block"?"none":'block'
    }
    function setname(){
        name1.innerHTML=nameinput.value
    }
